import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'

function APP() {
  return (
      <Container>
        <Row>
          <Col>
           md={{
               span:6,
               offset:3,
           }}
          </Col>
        </Row>
      </Container>
  )
}

export default APP
